import React, { Fragment } from 'react'

const Footer = () => {
  return (
    <Fragment>
        <footer class="py-1">
            <p class="text-center text-white mt-1">
                Shopping Cart - 2019-2020, All Rights Reserved
            </p>
        </footer>
    </Fragment>
  )
}

export default Footer
